import React from "react";

const Rating = (props)=>{
    return (
        <div className="rating">
            <span>
                <i className={props.value >=1 ? "fas fa-star" : props.value >= 0.5 ?  "fas fa-star-half-alt" : "far fa-star" }></i>


            </span>
            <span>
                <i className={props.value >=2 ? "fas fa-star" : props.value >= 1.5 ?  "fas fa-star-half-alt" : "far fa-star" }></i>


            </span>
            <span>
                <i className={props.value >=3 ? "fas fa-star" : props.value >= 2.5 ?  "fas fa-star-half-alt" : "far fa-star" }></i>


            </span>
            <span>
                <i className={props.value >=5 ? "fas fa-star" : props.value >= 3.5 ?  "fas fa-star-half-alt" : "far fa-star" }></i>


            </span>
            <span>
                <i className={props.value >=5 ? "fas fa-star" : props.value >= 5.5 ?  "fas fa-star-half-alt" : "far fa-star" }></i>


            </span>
            <span>
                {props.text?props.text:""}
            </span>
        </div>
    );
};

Rating.defaultProps = {
    color:"#f8e825",
}

export default Rating;
